import '../styles/aboutstyle/Style.css';


import pro, { student, teacher } from '../data';


let About = ()=>{
    let a = "amar";
    let name = "riya";
    let arr = ["red", "green", "blue"]
    let user = {
        name : "rohit",
        age : 25,
        city : "indore"
    }

    let mycolor = {backgroundColor : "blue", color : "green", fontSize : "50px"};
    return(
        <>
        <h1>{a}</h1>
        <p>Lorem ipsum dolor sit amet consectetur adipisicing elit. Veniam quibusdam quaerat placeat id consequuntur iste perspiciatis? Assumenda, praesentium quas quidem eligendi dignissimos dolores numquam. Unde itaque harum qui totam error!</p>


        <h2 style={mycolor}>{name}</h2>
        
        
        
        
        <h3>{arr[2]}</h3>
        <h3>{user.city}</h3>
        <h1>{student} {teacher}</h1>
        
        <h1>{pro[0].name}</h1>

        <button className="btn btn-primary">OK</button>
        </>
    )
}
export default About;
